import React from "react";
import { useEffect, useState, createElement } from "react";
import { useParams } from "react-router-dom/cjs/react-router-dom.min";
import { Switch, Route, Link } from "react-router-dom";
import axios from "axios";
import { useHistory } from "react-router-dom/cjs/react-router-dom.min";

const Card = (props) => {
    const [style, setStyle] = useState("cardText1");
    const [style2, setStyle2] = useState("cardText2");

    const onMouseEnterEventHandler = () => {
        setStyle("cardText1");
    };
    const onMouseLeaveEventHandler = () => {
        setStyle("cardTexth1");
    };
    const onMouseEnterEventHandler2 = () => {
        setStyle("cardTexth2");
    };
    const onMouseLeaveEventHandler2 = () => {
        setStyle("cardText2");
    };

    return (
        <>
            <div
                id="cardOutline"
                style={{ backgroundImage: `url(${props.imageUrl})` }}
            >
                <div
                    id={style}
                    onMouseEnter={onMouseEnterEventHandler}
                    onMouseLeave={onMouseLeaveEventHandler}
                    ></div>
                <div
                    id={style2}
                    onClick={onMouseEnterEventHandler2}
                    onMouseLeave={onMouseLeaveEventHandler2}
                ></div>
            </div>
        </>
    );
};

export default Card;
